    const {currentYear} = this.props

    return (
      <footer>
        <p>
          &copy; {currentYear} Kevin Vanantwerpen
        </p>
        <ul>
          <li>LinkedIn</li>
          <li>GitHub</li>
        </ul>
      </footer>
    );
  }
}

export default Footer;
